import React, { Component } from 'react';
import ProjectsList from './projectsList';

class Featured extends Component {

	constructor(props){
	  super(props)
	  this.state = {
	  	river: "highlight",
	  	dd: "highlight",
	  	mm: "highlight"
	  }
	}	

	mouseEnter = (project) => {
		//return current project
		//this.props.hoverDisplay("river")
		this.setState({
	      river: "onlight"
	    })	
	}
	mouseExit = (project) => {
		//clear current
		this.setState({
	      river: "highlight"
	    })		
	}

	render() {
		return(
			<div className= "featured">
			  <ProjectsList/>
			  	<div className = "highlight spotlight">
					<h5>
						hover over the featured projects to learn more about them. click on the project to get more indeph information.
					</h5>
					</div>

			</div>
		)
	}
}

export default Featured
